import React, { createContext, useContext } from 'react';

const crypto = createContext();

const CryptoContext = ({children}) => {
  return (
    <crypto.Provider>
       {children}
    </crypto.Provider>
  )
}

export default CryptoContext;

export const CryptoState = () => {
   useContext(crypto)
}
